import React from 'react';
import bachelorArticle from '../assets/bachelor.png';
import './styles.css';

export default function Projects() {
    return (
        <div className="Body">
            <h1>Projects</h1>

            <img src={bachelorArticle} alt="Article" />
        </div>
    )
}
